css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("yourdictionary.com")

{

/*text&background*/

html, body, tbody, thead, th, tr, td, blockquote, li, ul, h1, h2, h3, h4, h5, h6, p, form, footer, div#browseWords, div.padWrap, div.contentWrap, div.hdrMainHome, div#wrapOuter, div.box, div.box2, div.panel

{
color: white !important;
background: black !important;
}

#search

{
color: white !important;
}

/*links*/

a

{
color: #0040ff !important;
}

/*highlight*/

textarea, pre, #search

{
background: #333333 !important;
}

}
